import React from 'react'

const TableHeader = () => {
    return (
        <thead>
            <tr>
                <th>Seller Type</th>
                <th>Average in Euro</th>
            </tr>
        </thead>
    );
}

const TableBody = ({ value }) => {
    return (
        <tbody>
            <tr >
                <th>other</th>
                <td>{value.other}</td>
            </tr>
            <tr >
                <th>Dealer</th>
                <td> € {value.dealer}, -</td>
            </tr>
            <tr >
                <th>private</th>
                <td> € {value.private}, -</td>
            </tr>
        </tbody>
    );
}
const AverageListing = ({ averageListing }) => {
    return (
        <div>
            <center><h1>Average Listing</h1></center>

            <div class="card">
                <div class="card-body">
                    <table>
                    <TableHeader />
                    <TableBody value={averageListing} />
                    </table>
                </div>
            </div>

        </div>
    )
};

export default AverageListing
